import "/home/marv/the-odin-project/react-projects/anime-search/src/HomePage/homepage.css";
import "/home/marv/the-odin-project/react-projects/anime-search/src/HomePage/NavBar/navbar.css";
import background from "/home/marv/the-odin-project/react-projects/anime-search/src/HomePage/Images/main-background.jpg";
import NavBar from "./NavBar/NavBar";
export default function HomePage() {

  function toggleFullScreen() {
    var doc = window.document;
    var docEl = doc.documentElement;

    var requestFullScreen =
      docEl.requestFullscreen ||
      docEl.mozRequestFullScreen ||
      docEl.webkitRequestFullScreen ||
      docEl.msRequestFullscreen;
    var cancelFullScreen =
      doc.exitFullscreen ||
      doc.mozCancelFullScreen ||
      doc.webkitExitFullscreen ||
      doc.msExitFullscreen;

    if (
      !doc.fullscreenElement &&
      !doc.mozFullScreenElement &&
      !doc.webkitFullscreenElement &&
      !doc.msFullscreenElement
    ) {
      requestFullScreen.call(docEl);
    } else {
      cancelFullScreen.call(doc);
    }
  }

  return (
    <div onLoad={toggleFullScreen} id="fullScreen">
      <div className="navbar">
      <NavBar />
      </div>
      <img className="background-image" src={background} alt="background" />
    </div>
  );
}
